import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
    display: flex;
    background-color: gray;
    width: 100%;
`;
const Title = styled.h1`
    text-transform: uppercase;
`;

export default function Basket() {
    return (
        <div>

            <Container>
                <Title>Hi</Title>

            </Container>

        </div>
    )
}
